import { Add } from '@mui/icons-material';
import {
  Button,
  List,
  ListSubheader,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  ListItem,
  IconButton,
  Grid,
  Typography,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import { useEffect, useState } from 'react';
import { fetchData } from '../utils';

const Courses = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData('author/courses/', setData);
  }, []);

  return (
    <>
      <Button onClick={() => console.log(data)} variant='contained' startIcon={<Add />}>
        Add Course
      </Button>
      <List
        sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}
        component='nav'
        aria-labelledby='nested-list-subheader'
        subheader={
          <ListSubheader component='div' id='nested-list-subheader'>
            Nested List Items
          </ListSubheader>
        }
      >
        {Object.values(data).map((course) => (
          <ListItem key={course.id} disablePadding>
            <Grid container spacing={0} flexGrow={1}>
              <Grid item>
                <ListItemText width='100%' color='inherit' primary={course.title} />
              </Grid>
            </Grid>
          </ListItem>
        ))}
      </List>
    </>
  );
};

export default Courses;
